        content: `Perjantaikuulutukset! Friday Announcements!
Ensi viikolla…
maanantai:
Spoken skills: Miten sä voit?,  + Skill Check open all day!, Tiina
tiistai:
Verbityyppi 3 ja 4, Tiina
keskiviikko:
Verbityyppi 3 ja 4 KPT-gradation, Tiina
torstai:
Nesessiivi - Minun täytyy…, Tiina
Spoken skills to the MAX
Starting next week we will start offering extra Spoken skills lessons for you guys. These
 lessons are offered to you and our another group (Ahmat), so you might meet some new people.
 These lessons are completely voluntary but highly recommended. You won't learn speaking any
 other way than speaking. The system is the same as in basic spoken skills lessons; we will
 give you a list of questions, and before coming to the lesson you'll read them, understand
 them and think how to answer them. After each lesson we will post a link to the recording
 and it will be watchable for five days.
Lessons are on Wednesday and Thursday 12:15-13:30.
The questions are same on both days, so you can participate just once, or if you want
 extra-practice, you can participate twice.
keskiviikko:
Minä, Netta
torstai:
Minä, Tiina
All the materials are in the Classroom.
Skill Check of Moduuli 1 on Monday open all day!
You need to complete it some time during Monday (13th). It is
not a test,
you can't fail that, results will not affect your future in the training. It is for me to
 see how we are doing! It is a bad thing not to complete the Skill Check or cheat your way
 through it, it is meant for us to check what you know already, so it is very important that 
 you
DO NOT USE DICTIONARY, NOTES, MATERIALS OR LEAST OF ALL GOOGLE TRANSLATE.
Use about one hour to complete the assignment. I can't monitor your time use, so it is
 between you and your conscience. Don't stress, this is just a big homework assignment that
 you have to do without any help. Just do your best, that is enough.
I'll open the assignment at 8am. It will close late Monday evening. (FInnish times).
Remember that all the other homework assignments from Moduuli 1 need to be completed by
 Monday.
Moduuli 2 starts officially on Tuesday, so I'll post the links for independent studies and
 Quizlet here already.
Hyvää viikonloppua, nähdään ensi viikolla!`,
