        date: '12 May 2023',
        deleted: false,
        content: `Puhetesti
Tänään on puhetestipäivä, hurraa!
It is spoken skills test day, hooray!
I know that you might be feeling anxious and stressed, but try to breathe and calm down.
 This is not super difficult or scary, we have been practicing for this. It is just me, Netta
 and some old spoken skills questions.
Important things to remember are as follows:
Try to find as quiet, calm and comfortable a place as you can for the test. All extra noise
 disturbs your focus as well as your group mate's. Closets and bathrooms have been very
 popular places in the past.
You need to have your microphone and camera on during the test.
All the notes, dictionaries and translators are forbidden, obviously. This is the time you
 need to trust yourselves, you need to use the skills you have. Cheating will lead to
 automatic failure of the test.
Join Zoom a couple of minutes before your test starts, wait patiently in the waiting room.
During the test it is okay to ask us to repeat, to speak lower, to say that you don't
 understand and even pass a question.
Useful phrases:
1. Can you repeat? = Voitko toistaa?
2. Can you speak slower? = Voitko puhua hitaammin?
3. I don't understand. = En ymmärrä.
Nähdään pian, see you soon! We'll start 9 am. Check your own time!
https://arffman.zoom.us/my/tiinalampen
My meeting ID is: 806 378 7231`,
